            // <button className='newRoom' style={{backgroundColor: props.color}} >
            //     {props.name}
            // </button>
        props.flag(true)
        }
    }

  return (
    <div className='mainDiv'>
    <h2 className='title'>Smart house</h2>
    <Link to={'/addroom'}><button className='btn'>+</button></Link>
    {createRoom}
    </div>
  )
}
